import React from "react"
import Card from "./Card.js"
import emojipedia from "../emojipedia.js"

function CreateCard(emoji) {
    return <Card 
    key={emoji.id}
    name={emoji.name}
    emoji={emoji.emoji}
    title={emoji.meaning}
    />
}

export default CreateCard;
